        return new Source("{% extends 'base.html.twig' %}

{% block title %}S'inscrire{% endblock %}

{% block body %}
    {% for flash_error in app.flashes('verify_email_error') %}
        <div class=\"alert alert-danger\" role=\"alert\">{{ flash_error }}</div>
    {% endfor %}
    <section class=\"container\">
        <div class=\"row\">
            <div class=\"class\">
                <h1 class=\"text-center mt-2 mb-3\">Inscription</h1>
                    {{ form_start(registrationForm) }}
                        <fieldset class=\"fieldset-register mb-2\">
                            <legend>Mon identité</legend>
                            {{ form_row(registrationForm.name) }}
                            {{ form_row(registrationForm.firstname) }}
                            
                        </fieldset>

                        <fieldset class=\"fieldset-register mb-2\">
                            <legend>Mes coordonnées</legend>
                            {{ form_row(registrationForm.email) }}
                            {{ form_row(registrationForm.phoneNumber) }}
                        </fieldset>

                        <fieldset class=\"fieldset-register mb-2\">
                            <legend>Allergies alimentaires</legend>
                            {{ form_row(registrationForm.allergies) }}
                        </fieldset>

                        <fieldset class=\"fieldset-register mb-2\">
                            <legend>Informations complémentaires</legend>
                            {{ form_row(registrationForm.guestBooking) }}
                        </fieldset>

                        <fieldset class=\"fieldset-register mb-2\">
                            <legend>Mon compte</legend>
                            {{ form_row(registrationForm.plainPassword, {label: 'Choisir un mot de passe'}) }}
                            {{ form_row(registrationForm.agreeTerms) }}
                        </fieldset>

                <section  class=\"text-center\">
                        <button type=\"submit\" class=\"btn btn-custom my-3\">M'inscrire</button>
                </section>

                {{ form_end(registrationForm) }}
                <section  class=\"text-center\">
                        <hr class=\"hr-custom\">
                        <p class=\"pt-2\" >J'ai déjà un compte ? </p>
                        <a href=\"{{ path('login') }}\" class=\"btn btn-custom\">Me connecter</a>
                </section>
            </div>
        </div>
    </section>
{% endblock %}", "registration/register.html.twig", "C:\\xampp\\htdocs\\QuaiAntique-AG\\templates\\registration\\register.html.twig");
